import React, { Component } from 'react';

import { Stack } from 'office-ui-fabric-react/lib/Stack';

class Navbar extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <nav>
                <Stack>
                    <span>Home</span>
                    <span>People</span>
                    <span>About</span>
                    <span>Blog</span>
                </Stack>
            </nav>
        )
    }
}

export default Navbar;
